// App.js
import React, { useState } from 'react';
import './styles.css';

const App = () => {
    const [formData, setFormData] = useState({
        complexion: '',
        travelLocation: '',
        gender: '',
        size: '',
        physique: '',
    });

    const [suggestions, setSuggestions] = useState([]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const response = await fetch('http://localhost:5000/api/suggestions', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formData),
        });
        const data = await response.json();
        setSuggestions(data.styling);
        alert(data.message);
    };

    return (
        <div>
            <h1>Styling Suggestions</h1>
            <form onSubmit={handleSubmit}>
                {/* Complexion Dropdown */}
                <label>
                    Complexion:
                    <select name="complexion" onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="light">Light</option>
                        <option value="medium">Medium</option>
                        <option value="dark">Dark</option>
                    </select>
                </label>

                {/* Travel Location Dropdown */}
                <label>
                    Travel Location:
                    <select name="travelLocation" onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="beach">Beach</option>
                        <option value="mountains">Mountains</option>
                        <option value="city">City</option>
                        <option value="countryside">Countryside</option>
                    </select>
                </label>

                {/* Gender Dropdown */}
                <label>
                    Gender:
                    <select name="gender" onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="male">Male</option>
                        <option value="female">Female</option>
                        <option value="other">Other</option>
                    </select>
                </label>

                {/* Size Dropdown */}
                <label>
                    Size:
                    <select name="size" onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="small">Small</option>
                        <option value="medium">Medium</option>
                        <option value="large">Large</option>
                        <option value="plus-size">Plus-size</option>
                    </select>
                </label>

                {/* Physique Dropdown */}
                <label>
                    Physique:
                    <select name="physique" onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="slim">Slim</option>
                        <option value="athletic">Athletic</option>
                        <option value="average">Average</option>
                        <option value="curvy">Curvy</option>
                    </select>
                </label>

                <button type="submit">Get Suggestions</button>
            </form>

            {/* Suggestions */}
            {suggestions.length > 0 && (
                <div>
                    <h2>Suggestions:</h2>
                    <ul>
                        {suggestions.map((item, index) => (
                            <li key={index}>{item}</li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default App;
